Kaba yemler sığırlar için 1.5-2.5 cm uzunluğunda doğranması tavsiye edilmektedir.
.
Bu değerlerden daha ince doğranan ya da öğütülen kafa yemler hayvanlar da bazı tüketim ve sindirim bozukluklarına yol açabilmektedir.
.
Kaba yemlerin özellikle çok ince öğütülmesi genelde tavsiye edilmez. Çünkü bu durumda hayvanlar da tüketim ve sindirim bozukluklarının yanı sıra bu işleme tabi tutulmuş kaba yemlerin enerjitik değerlerinde %10'lara varan azalmalar ortaya çıkabilmektedir.
.
Bunun için kaba yemler eğer peletlenecek ise asla öğütülmemeli, belli partikül büyüklüğünde doğranarak işleme alınmalıdırlar.
.
.
